- input: "TEXT\x1CC00228379\x1CSA16.6251.TEXT\x1CSA16.6251\x1CSA16\x1COn May 17, 2010,
    'A Lot of People for Dave Obey' committee refunded a $1,000 contribution we made
    to the committee on 3/22/10.  The refund was written out of Dave Obey's commitee
    account and was received and deposited by the Roetzel & Andress accounting department.
    \ On June 30, 2010, it was determined by the accounting department that the check
    had been misdeposited.  The department then wrote a firm check in the amount of
    $1,000 payable to the Roetzel & Andress Co. LPA FSL PAC, and that check was deposited
    into the federal PAC account on 7/2/10.\n"
